import React from 'react';
import { Test } from './Test';
import { Header } from '../Base/Header';
// import { Navbar } from "../../Base/Navbar"
import { Nb } from "../Base/Nb";

class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return(
      <div>
        <Header />
        <Test />
        <Nb />
      </div>
    );
  }
}

export default App;
